'''''Carandaith'' Vol. 1, No. 2''' is an issue of the fanzine [[Carandaith]], published by the [[Australian Tolkien Society]]. The magazine reprints the article "The Realms of Tolkien" by [[Daphne Castell]] from [[New Worlds Vol. 50, No. 168|''New Worlds'' Vol. 50, No. 168]], which includes extracts from [[Index:Interviews with J.R.R. Tolkien|an interview]] with [[J.R.R. Tolkien]].<ref>{{webcite|author=|articleurl=http://www.tolkienbooks.net/php/details.php?reference=53490|articlename=Carandaith. 1969|dated=|website=TB|accessed=5 July 2012}}</ref>

